return categories.map(catName => ({
  json: {
    source: "Treendly",
    category: catName
  }
}));

// Force-get all Treendly items as an array
const treendlyItems = $node["TreendlyClean"].json ? [$node["TreendlyClean"].json] : $node["TreendlyClean"].data;

// If not in correct format, try $node.all()
let categories = [];
if (Array.isArray(treendlyItems)) {
  categories = treendlyItems.map(i => (i.category || "").toLowerCase());
} else {
  categories = $items("TreendlyClean").map(i => (i.json.category || "").toLowerCase());
}

// Get GNews items safely
let articles = [];
try {
  articles = $items("GNewsClean");
} catch (err) {
  // fallback if no index
  articles = $node["GNewsClean"].json ? [$node["GNewsClean"].json] : [];
}

const scored = [];

for (const article of articles) {
  const headline = (article.json?.headline || "").toLowerCase();
  const summary = (article.json?.summary || "").toLowerCase();

  // Match category: first word match OR category phrase in text
  const matchingCategory = categories.find(cat =>
    cat && (headline.includes(cat.split(" ")[0]) || headline.includes(cat) || summary.includes(cat))
  );

  if (matchingCategory) {
    scored.push({
      category: matchingCategory,
      headline: article.json?.headline,
      summary: article.json?.summary,
      url: article.json?.url,
      published: article.json?.published,
      score: Math.random() * 100 // Replace with smarter scoring
    });
  }
}

// Sort top 3
scored.sort((a, b) => b.score - a.score);
return scored.slice(0, 3).map(s => ({ json: s }));
